import Noidung from '../edit_tintuc/noidung';
//import Noidung3 from '../edit_tintuc/noidung3';
import Noidung9 from '../edit_tintuc/noidungds1';
import Noidung10 from '../edit_tintuc/noidungds2';
import Noidung11 from '../edit_tintuc/noidungds3';
import Tieude from '../edit_tintuc/tieude';

function Doisong() {
    return (<
        div className="news_ds" >
        <
        div className="news_td" >
            <
        div className="td_title" >
                <
                    img src="img/Path_213.png"
                    alt="true"
                    width="7"
                    height="40" />
                <
                    Tieude title="Đời sống" />
                <
        /div> <
        /div> <
        div className="news_nd" >
                    <
                        Noidung9 />
                    <
                        Noidung10 />
                    <
                        Noidung11 />
                    <
        /div> <
        /div>
    );
}
export default Doisong;
